"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Removing objects stuck up the nose (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/removing-objects-stuck-up-the-nose-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H13620963\">",
"      <span class=\"h1\">",
"       Does an object stuck up the nose cause symptoms?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sometimes. People with an object stuck up the nose usually have no symptoms. If people do have symptoms, they can have:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Trouble breathing through the nostril with the object in it",
"       </li>",
"       <li>",
"        Bleeding from the nose",
"       </li>",
"       <li>",
"        Pain in the nose",
"       </li>",
"       <li>",
"        Bad-smelling fluid draining out of the nose",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13620978\">",
"      <span class=\"h1\">",
"       Should I remove an object stuck up my child&rsquo;s nose on my own?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. Do not try to grab or pull out an object that is stuck up your child&rsquo;s nose. If you do, you might push the object deeper into the nose or push it to the back of the nose. From the back of the nose, the object can fall into and get stuck in the wind pipe. Or your child might breathe it into his or her lungs (",
"      <a class=\"graphic graphic_figure graphicRef56535 \" href=\"UTD.htm?28/23/29044\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13620993\">",
"      <span class=\"h1\">",
"       Is there anything I can do to help my child on my own?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. You can have your child try to blow the object out of his or her nose. To do this:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Hold the nostril without the object closed",
"       </li>",
"       <li>",
"        Have your child blow air out of the nostril that has the object in it",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If the object comes out, your child&rsquo;s nose might bleed for a short time. To stop the bleeding, gently pinch the end of the nose closed for 10 minutes. You can also put a cold pack on the nose or cheeks. If your child&rsquo;s nose is bleeding, do not tilt his or her head back. Tilting the head back does not stop a nosebleed and could make your child swallow blood.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13621008\">",
"      <span class=\"h1\">",
"       Should I call my child&rsquo;s doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Call the doctor or nurse right away.",
"     </p>",
"     <p>",
"      If your child can&rsquo;t blow the object out of his or her nose, the doctor or nurse will need to remove it. Depending on the object and other factors, the doctor or nurse might be able to remove the object in the office. If not, he or she will have you go to the emergency room or to an ear, nose, and throat (ENT) doctor to have it removed. Batteries (such as button or disc batteries) and beads usually need to be removed in the emergency room.",
"     </p>",
"     <p>",
"      Even if your child blew the object out of his or her nose, you will still need to see the doctor or nurse. He or she will do an exam and check that no other objects are in your child&rsquo;s nose or ears. (Children sometimes put objects in their ears, too.)",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13621023\">",
"      <span class=\"h1\">",
"       How will the doctor or nurse remove the object?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The doctor or nurse can use different tools to look inside the nose and remove the object. Before he or she removes the object, he or she might put drops in the nose to numb the nose and reduce swelling. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13621038\">",
"      <span class=\"h1\">",
"       Will my child need any other treatment?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Maybe. Objects that are stuck in the nose for a long time can sometimes cause a sinus infection. The sinuses are hollow areas in the bones of the face (",
"      <a class=\"graphic graphic_figure graphicRef75045 \" href=\"UTD.htm?9/62/10210\">",
"       figure 2",
"      </a>",
"      ). If your child has a sinus infection, he or she might need to take antibiotic medicines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13621053\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
