" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 518px\">",
"   <div class=\"ttl\">",
"    Erratic carbohydrate intake prevents glycemic control",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 498px; height: 211px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Carbohydrate (CHO) profiles from 6 AM to 12 AM on two consecutive days in a 57 year-old woman with fluctuating blood glucose concentrations (shown, in mg/dL, by the numbers in the graphs). Each column represents the CHO intake at a meal or snack. Both the total CHO intake and the distribution of CHO intake vary markedly, a change that was even more marked on the day 3 when total CHO intake was 267 grams (not shown). The asterisk on day 1 indicates mild hypoglycemic symptoms at that time. To convert blood glucose values to mmol/L multiply by 0.056.",
